FeedPackage.ReleaseNotes:
Allow localized texts, run the following settings before load your tables

		AjaxDataTable.defaults.texts = {
			next: "Next in my language »",
			previous: "« Previous in my language",
			page: "Page",
			display: "Displayed from {start} to {end} out of {total} in my language"
		};

		or send it as options

		AjaxDataTable.render($("#my-list"), {
			texts = {
						next: "Next in my language »",
						previous: "« Previous in my language",
						page: "Page",
						display: "Displayed from {start} to {end} out of {total} in my language"
					}		
        });

- new refresh function: Instead of using AjaxDataTable.render($("#my-table"), 'refresh', { refresh options }), now you can use AjaxDataTable.refresh($("#my-table"), { refresh options }), with the same functionality.
	- page setting: allow setting page to load.
		AjaxDataTable.render($("#my-table"), { page: 9 }); 
		Note: page is started from 0.
	- render accepts string: AjaxDataTable.render("#my-table");
